import { Card, CardBody, CardTitle, Container, Row, Col } from "reactstrap";
import { fetchAllDrivers } from "services/onboarding-service";
import axios from "axios";
import { endpoints } from "../../api-endpoints";
import { useDispatch, useSelector } from "react-redux";
import { useState, useEffect } from "react";
import { isSuccessful } from "../../utils/tools";
// import { useSelector, useDispatch } from "react-redux";
import { fetchDrivers } from "services/onboarding-service";




const Header = () => {

  // const dispatch = useDispatch();
  const [drivers, setDrivers] = useState();
  // const [, setIsFetching] = useState(false);

  const [users, usersSet] = useState([]);

  React.useEffect(() => {
    async function fetchUsers() {
      const fullResponse = await fetch("https://reqres.in/api/users");
      const responseJson = await fullResponse.json();
      usersSet(responseJson.data);
    }

    fetchUsers();
  }, []);

  // const doFetchDrivers = async () => {
  //   try {
  //     setIsFetching(true);
  //     const res = await fetchAllDrivers();
  //     setIsFetching(false);
  //     if (res && isSuccessful(res?.responseCode)) {
  //       setDrivers(res.responses);
  //       console.log("Created drivers>>>>>>>: from header", res?.responseCode);
  //     }
  //   } catch (error) {
  //     setIsFetching(false);
  //     // handleMyErrors(error);
  //   }
  // };

  //   useEffect(() => {
  //     dispatch(fetchDrivers());
  //   }, [dispatch]);




  // useEffect(() => {
  //   doFetchDrivers();
  //       console.log("Created driver>>>>>>>:", drivers);

  //   return () => {};
  //   // eslint-disable-next-line react-hooks/exhaustive-deps
  // }, [drivers]);



useEffect(() => {
  async function fetchUsers() {
    const fullResponse = await axios.get(endpoints.getDrivers);
    const responseJson = await fullResponse.json();
    console.log("Created drivers>>>>>>>: from headers", responseJson)
    setDrivers(responseJson.count);
  }

  fetchUsers();
}, []);
  return (
    <>
      <div className="header bg-gradient-info pb-8 pt-5 pt-md-8">
        <Container fluid>
          <div className="header-body">
            {/* Card stats */}
            <Row>
              <Col lg="6" xl="3">
                <Card className="card-stats mb-4 mb-xl-0">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle
                          tag="h5"
                          className="text-uppercase text-muted mb-0"
                        >
                          Traffic
                        </CardTitle>
                        <span className="h2 font-weight-bold mb-0">
                          350,897
                        </span>
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-danger text-white rounded-circle shadow">
                          <i className="fas fa-chart-bar" />
                        </div>
                      </Col>
                    </Row>
                    <p className="mt-3 mb-0 text-muted text-sm">
                      <span className="text-success mr-2">
                        <i className="fa fa-arrow-up" /> 3.48%
                      </span>{" "}
                      <span className="text-nowrap">Since last month</span>
                    </p>
                  </CardBody>
                </Card>
              </Col>
              <Col lg="6" xl="3">
                <Card className="card-stats mb-4 mb-xl-0">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle
                          tag="h5"
                          className="text-uppercase text-muted mb-0"
                        >
                          New users
                        </CardTitle>
                      {/* {drivers.map((driver) => (
                        <span className="h2 font-weight-bold mb-0">

                            {driver.count}

                        </span>))} */}
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-warning text-white rounded-circle shadow">
                          <i className="fas fa-chart-pie" />
                        </div>
                      </Col>
                    </Row>
                    <p className="mt-3 mb-0 text-muted text-sm">
                      <span className="text-danger mr-2">
                        <i className="fas fa-arrow-down" /> 3.48%
                      </span>{" "}
                      <span className="text-nowrap">Since last week</span>
                    </p>
                  </CardBody>
                </Card>
              </Col>
              <Col lg="6" xl="3">
                <Card className="card-stats mb-4 mb-xl-0">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle
                          tag="h5"
                          className="text-uppercase text-muted mb-0"
                        >
                          Sales
                        </CardTitle>
                        <span className="h2 font-weight-bold mb-0">924</span>
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-yellow text-white rounded-circle shadow">
                          <i className="fas fa-users" />
                        </div>
                      </Col>
                    </Row>
                    <p className="mt-3 mb-0 text-muted text-sm">
                      <span className="text-warning mr-2">
                        <i className="fas fa-arrow-down" /> 1.10%
                      </span>{" "}
                      <span className="text-nowrap">Since yesterday</span>
                    </p>
                  </CardBody>
                </Card>
              </Col>
              <Col lg="6" xl="3">
                <Card className="card-stats mb-4 mb-xl-0">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle
                          tag="h5"
                          className="text-uppercase text-muted mb-0"
                        >
                          Performance
                        </CardTitle>
                        <span className="h2 font-weight-bold mb-0">49,65%</span>
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-info text-white rounded-circle shadow">
                          <i className="fas fa-percent" />
                        </div>
                      </Col>
                    </Row>
                    <p className="mt-3 mb-0 text-muted text-sm">
                      <span className="text-success mr-2">
                        <i className="fas fa-arrow-up" /> 12%
                      </span>{" "}
                      <span className="text-nowrap">Since last month</span>
                    </p>
                  </CardBody>
                </Card>
              </Col>
            </Row>
          </div>
        </Container>
      </div>
    </>
  );
};

